        "Tutorial": "栖息于深山中的仙兽，会周期性凝聚仙力，交替释放<b>水终结技</b>和<b>风终结技</b>，期间全部抗性提升200%，持续10秒。<br><br>水终结技：在周围随机地段，持续造成水元素伤害。结束时，在7个大型圆形区域内翻起巨浪，造成巨额水元素伤害。<br><b>期间自身会附着水元素。利用冰元素使其冻结，再使用<color style='color:#f29e38;'>超导、融化、扩散、结晶、碎冰反应</color>破坏其冻结状态，可以解除其抗性提升效果，并使其短暂瘫痪。</b><br><br>风终结技：召唤3枚移动的灵风珠，并在周围随机地段，持续造成风元素伤害。结束时，对全场造成巨额风元素伤害，剩余的灵风珠将转化为涡眼，持续牵引角色并造成伤害。<br><b>利用<color style='color:#f29e38;'>雷、水、冰、火元素</color>触发扩散反应破坏全部灵风珠，可以解除其抗性提升效果，并使其短暂瘫痪。</b><br><br>水终结技和风终结技会交替释放，间隔30s~60s，第一次必定为水。生命值降低至70%时，无视间隔使用一次水终结技。生命值降低至40%时，无视间隔使用一次风终结技。<br><b>深渊特化版：入战后立刻使用水终结技，然后立刻使用风终结技。</b>",
