        "Desc": "一定程度上能够悬浮的爬行动物。\n飞蛇并不具备「飞行」的能力，悬浮的能力似乎是借助了与鸟类相同的中空骨骼，与其中风元素的残渣。沙漠不是风元素的国度，但其中常年呼啸着侵蚀一切的风。无论是城池或是历史，都会被沙海的风慢慢磨成细沙。只有能与这种风共生的动物，才能在一切都回归尘土后依然生存在沙海中。",
