        "Desc": "汇聚须弥教令院六大学院力量制造出的人造正机神，拥有比肩真神的威能。\n世人若称之为伪神，则是不懂得「神」的真意。\n假如超人者为神，\n正机神已通晓万事背负无上力量，谓之超人。\n假如爱人者为神，\n正机神亦懂得赐予人平等的失败，谓之爱人。\n假如观人者为神，\n……\n…………\n正机神窥得无数爱憎别离怨嗔痴，谓之观人。\n\n<i>「汝等已拥有太多的幸福，</i>\n<i>「因此变得愚昧自大，贪婪可怖。</i>\n<i>「终结这个时代！</i>\n<i>「新的神明，宣告旧神将败北。</i>\n<i>「可悲的人类…现在还来得及跪下。」</i>",
